<?php

class TorrentTest extends \PHPUnit\Framework\TestCase
{

    /**
     * @var \Openseedbox\Parser\Torrent
     */
    private $parser;
    /**
     * @var \Openseedbox\Parser\Openseedbox\Parser\TorrentInterface|\Openseedbox\Parser\Torrent
     */
    private $torrent;

    protected function setUp(): void
    {
        $this->parser  = new Openseedbox\Parser\Torrent;
        $this->torrent = $this->parser->parse(base64_decode($this->getTorrentData()));
    }

    public function testGetInfoHash()
    {
        $hash = $this->torrent->getInfoHash();
        $this->assertNotNull($hash);
        $this->assertEquals("91c1c0ad9fba72d28a4e91e5ed42e9fae0c03781", $hash);
    }

    public function testGetName()
    {
        $name = $this->torrent->getName();
        $this->assertNotNull($name);
        $this->assertEquals("Avicii - Wake Me Up.mp3", $name);
    }

    public function testIsFromMagnet()
    {
        $this->assertFalse($this->torrent->isFromMagnet());
    }

    public function testGetBase64Metadata()
    {
        $this->assertEquals($this->getTorrentData(), $this->torrent->getBase64Metadata());
    }

    public function testGetTotalSizeBytes()
    {
        $this->assertEquals(10059226, $this->torrent->getTotalSizeBytes());
    }

    public function testGetTrackerUrls()
    {
        $this->assertEquals([
            'udp://tracker.openbittorrent.com:80',
            'udp://tracker.publicbt.com:80',
            'udp://tracker.istole.it:6969',
            'udp://tracker.ccc.de:80',
            'udp://open.demonii.com:1337',
        ], $this->torrent->getTrackerUrls());
    }

    public function testGetMagnetUri()
    {
        $magnet = "magnet:?xt=urn:btih:91c1c0ad9fba72d28a4e91e5ed42e9fae0c03781&dn=Avicii+-+Wake+Me+Up.mp3&tr=udp%3A%2F%2Ftracker.openbittorrent.com%3A80&tr=udp%3A%2F%2Ftracker.publicbt.com%3A80&tr=udp%3A%2F%2Ftracker.istole.it%3A6969&tr=udp%3A%2F%2Ftracker.ccc.de%3A80&tr=udp%3A%2F%2Fopen.demonii.com%3A1337";
        $this->assertEquals($magnet, $this->torrent->getMagnetUri());
    }

    private function getTorrentData()
    {
        return "";
    }

}